class AppWebComponent {
    constructor(api, toastyService, spinner, navCtrl) {
        this.api = api;
        this.toastyService = toastyService;
        this.spinner = spinner;
        this.navCtrl = navCtrl;
        this.shipping = 'fixed';
        this.api.auth();
        this.getCurrennt();
    }
    ngOnInit() {
    }
    getCurrennt() {
        this.spinner.show();
        this.api.get('general').then((data) => {
            console.log(data);
            this.spinner.hide();
            if (data && data.status === 200) {
                if (data && data.data && data.data.length) {
                    this.haveSave = true;
                    const info = data.data[0];
                    this.id = info.id;
                    this.address = info.address;
                    this.city = info.city;
                    this.country = info.country;
                    this.email = info.email;
                    this.free = info.free;
                    this.min = info.min;
                    this.mobile = info.mobile;
                    this.shippingPrice = info.shippingPrice;
                    this.shipping = info.shipping;
                    this.state = info.state;
                    this.tax = info.tax;
                    this.zip = info.zip;
                    this.allowDistance = info.allowDistance;
                    this.facebook = info.facebook;
                    this.instagram = info.instagram;
                    this.twitter = info.twitter;
                    this.apple_appstore = info.apple_appstore;
                    this.google_playstore = info.google_playstore;
                    this.web_footer = info.web_footer;
                }
            }
            else {
                this.haveSave = false;
            }
            console.log('havesave?', this.haveSave);
        }, error => {
            console.log(error);
            this.spinner.hide();
            this.error(this.api.translate('Something went wrong'));
        }).catch(error => {
            console.log(error);
            this.spinner.hide();
            this.error(this.api.translate('Something went wrong'));
        });
    }
    error(message) {
        const toastOptions = {
            title: this.api.translate('Error'),
            msg: message,
            showClose: true,
            timeout: 2000,
            theme: 'default',
            onAdd: (toast) => {
                console.log('Toast ' + toast.id + ' has been added!');
            },
            onRemove: () => {
                console.log('Toast  has been removed!');
            }
        };
        // Add see all possible types in one shot
        this.toastyService.error(toastOptions);
    }
    success(message) {
        const toastOptions = {
            title: this.api.translate('Success'),
            msg: message,
            showClose: true,
            timeout: 2000,
            theme: 'default',
            onAdd: (toast) => {
                console.log('Toast ' + toast.id + ' has been added!');
            },
            onRemove: () => {
                console.log('Toast  has been removed!');
            }
        };
        // Add see all possible types in one shot
        this.toastyService.success(toastOptions);
    }
    submit() {
        if (!this.mobile || this.mobile === '' || !this.email || this.email === '' || !this.address || this.address === '' ||
            !this.city || this.city === '' || !this.state || this.state === '' || !this.zip || this.zip === '' || !this.country ||
            this.country === '' || !this.min || this.min === '' || !this.free || this.free === '' || !this.tax || this.tax === '' ||
            !this.shippingPrice || this.shippingPrice === '') {
            console.log('not ok');
            this.error('All Fields are required');
            return false;
        }
        if (this.haveSave) {
            console.log('update');
            const param = {
                mobile: this.mobile,
                email: this.email,
                address: this.address,
                city: this.city,
                state: this.state,
                zip: this.zip,
                country: this.country,
                min: this.min,
                free: this.free,
                tax: this.tax,
                shipping: this.shipping,
                shippingPrice: this.shippingPrice,
                id: this.id,
                allowDistance: this.allowDistance,
                facebook: this.facebook,
                instagram: this.instagram,
                twitter: this.twitter,
                apple_appstore: this.apple_appstore,
                google_playstore: this.google_playstore,
                web_footer: this.web_footer
            };
            console.log('param', param);
            this.spinner.show();
            this.api.post('general/editList', param).then((data) => {
                console.log('data', data);
                this.spinner.hide();
                if (data && data.status === 200) {
                    this.success('Setting updated');
                    this.haveSave = true;
                }
                else {
                    this.spinner.hide();
                    this.error(this.api.translate('Something went wrong'));
                }
            }, error => {
                console.log(error);
                this.spinner.hide();
                this.error(this.api.translate('Something went wrong'));
            }).catch(error => {
                console.log(error);
                this.spinner.hide();
                this.error(this.api.translate('Something went wrong'));
            });
        }
        else {
            console.log('create');
            console.log('ok');
            const param = {
                mobile: this.mobile,
                email: this.email,
                address: this.address,
                city: this.city,
                state: this.state,
                zip: this.zip,
                country: this.country,
                min: this.min,
                free: this.free,
                tax: this.tax,
                shipping: this.shipping,
                shippingPrice: this.shippingPrice,
                allowDistance: this.allowDistance,
                facebook: this.facebook,
                instagram: this.instagram,
                twitter: this.twitter,
                apple_appstore: this.apple_appstore,
                google_playstore: this.google_playstore,
                web_footer: this.web_footer
            };
            console.log('param', param);
            this.spinner.show();
            this.api.post('general/save', param).then((data) => {
                console.log('data', data);
                this.spinner.hide();
                if (data && data.status === 200) {
                    this.success('status updated');
                    this.haveSave = true;
                    this.id = data.data.id;
                }
                else {
                    this.spinner.hide();
                    this.error(this.api.translate('Something went wrong'));
                }
            }, error => {
                console.log(error);
                this.spinner.hide();
                this.error(this.api.translate('Something went wrong'));
            }).catch(error => {
                console.log(error);
                this.spinner.hide();
                this.error(this.api.translate('Something went wrong'));
            });
        }
    }
}


